                    "description": "嗨我是小王 欢迎来到帝都 北京\n\n关于卫生:本房间所有床品毛浴巾一客一换一消毒,清洁用品是威露士的有氧99%除菌洗衣液和威露士消毒液｡保证您的出行卫生｡\r\r房间位于三里屯南路,高级现代电梯公寓｡步行可达三里屯太古里,工体,使馆区,朝阳医院｡(周边配套齐全,不管你是看球､演唱会还是宿醉在北京的大街,吃网红店逛太古里,这个住处绝对c位｡)\r\r距离东大桥地铁站800米左右,出行便利｡(直达南锣鼓巷,北海公园,朝阳大悦城)\r打车大概十分钟可达世贸天阶,芳草地 ,蓝色港湾,悠唐广场｡\r北京站:3站地铁(打车大概25元左右)\r首都机场:打车大概60元左右｡\n\n60平米大开间,敞开式厨房,高层落地窗视野和采光都超级好,夜景也很美｡房间配有1.8*2.0的大双人床,100寸投影,西门子咖啡机,香薰机,100兆光纤Wi-Fi｡为您提供洗漱用品,一次性牙具梳子,洗发液沐浴露,毛浴巾,拖鞋,洗衣液｡\n\n关于做饭的要求:\n房间内可以做饭,请您自己洗掉自己用过的碗筷｡做饭的话请联系房东提前备好厨具材料,并且我们要加收50元清洁卫生费用｡民宿不是酒店,望理解｡\n\n关于入住和退房的要求:\n12点退房2点入住,入住时间稍弹性,根据当天打扫情况可能会提前或延后｡最晚12点退房,没有办法延迟,如您由于个人原因延迟超过一小时以上,根据当天房价加收百分之三十房费｡感谢合作｡\n\n房源内全部空间和设施\n\n你的小王为你提供当地好吃好喝一条龙服务\n\n步行可达三里屯 太古里,工人体育场｡\n\n保持房间卫生 谢谢",
