                "author_type": "human",
                "description": "体验北京胡同文化,打卡后海民宿,位于平安里地铁口100米,十分钟可达鼓楼,后海,上下两个卧室可住3—4人,适合一家人的旅行\n\n两层loft户型\n\n全自动洗衣机/独立浴室/55寸小米互联网电视/厨房/冰箱/24小时热水\n\n电子门锁,自助办理入住｡紧邻四号线平安里地铁站,出行方便,步行五分钟至护国寺小吃街,美食近在咫尺\n\n这里位置交通便利,到护国寺小吃街5分钟步行距离,到四号线地铁2分钟步行距离,老北京皇城根下品味胡同文化!\n\n平安里地铁A出口\n\n亲爱的客人,需要说明的是,我家阿姨每天下午三点下班整理房间,给客人换布草,所以如果前一天有客人入住,当天最早四点入住,但您可以提前放行李到房间｡如果前一天没有客人入住,您可以随时入住,包括当天上午也可以,感谢您的理解!",
