            "additional_house_rules": "其他守则:\n如期而至的家人,期待在旅途中为您创造温暖,也请您爱护它~\n以下是几条入住须知:\t\n1)进屋之后:请换上居家拖鞋,地毯区域须脱鞋;\n2)房间内禁止吸烟､酗酒;\n3)厨房可做饭,无需额外费用,如做饭则厨房请擦洗干净;\n4)请勿将卫生纸或杂物丢入马桶内;\n5)保持居室各房间整洁､及时清理垃圾,不要堆放在公共区域;\n6)为了不打扰周围邻居,房间内不可以太过吵闹､举办Party或者任何违法活 动,22:00后请保持安静;\n7)拍照目的或其他非入住目的,请单独与我沟通后再预订;\n8)目前还不可以带宠物来哦, 进出请保持安静不要打扰其他邻居休息;\n9)出门请记得关闭灯､门窗､空调､空气净化器等设备;\n10)请勿损坏/带走屋内物品\n11)根据北京公安机关的要求,每位入住客人都需要进行实名登记,包括身份证/护照/港澳通行证/台胞证等,以及VISA签证页｡房东需要登记,麻烦你预定后积极配合,谢谢~",
