                "author_type": "human",
                "description": "您好,很乐意在与您分享温暖的家,关于我们,你想知道的都在下面了,看过更心动:\n\n\n｢春风十里｣\n位于故宫西侧,新老交替传奇演变的灵境胡同､金融街一带,在高耸林立的新式建筑丛中依稀零落着民国样式的老房｡\n\n\n我家在安静的居民社区楼里,朝南两居室+餐厅一厨一卫,可住4人｡我将苍翠清新的森林搬进家里,满眼的绿意在美好的采光和通风下生机勃勃｡\n这仅仅是个视觉享受的开始!\n\n\n+闪光点:\n- 一间阳光热烈,一间清凉舒适,设计了可以席地而坐,喝茶看书的休息角落和靠窗沙发位｡\n- 空间宽敞,功能齐全的厨卫空间,还有可供4人欢聚共饮的独立餐厅\n- 除了全棉舒适大床,还有网络电视､高速Wi-Fi､空气净化器等\n\n\n+位置必须赞:\n- 几步之遥便是有百年商业历史,大腕儿云集的【金融街】､比备打卡地老牌步行购物街【西单】和京城最宽的【灵境胡同】,很适合走街串巷\n- 10分钟车程:天安门､故宫､北海公园､国家大剧院､国博首博等中心景区\n- 30分钟车程:北京西站/南站;40分钟:首都机场\n\n\n房间100%“一客一扫”,Live in Serendipity!\n\n·\n\n\n有一点动心,继续看看这里:\n\n\n+房间:\n70㎡两居室(带阳台)+餐厅+一厨一卫(干湿分离､独立洗漱)\n【带电梯､门禁】\n\n\n+床:\n卧室01:2*1.5米大床 + 1.8*1.3米单人沙发床\n卧室02:2*1.5米大床\n可住5人\n\n\n+家居:\n网络电视､小米空气净化器､烫手暖气､空调､大壁柜､居家拖鞋､雨伞､智能门锁､灭火器､烟雾报警器\n\n\n+厨房:\n燃气灶､热水壶､冰箱､电饭煲､烹饪锅具､汤勺碗筷､案板刀具､洗涤剂\n\n\n+卫生间:\n洗衣机､洗衣粉(液)､电热水器､暖气､24小时淋浴､高端毛巾､浴巾､浴室拖鞋､一次性牙具､洗手液､衣架､吹风机､洗发水､沐浴 (Website hidden by Airbnb) \n\n+自助入住\n我家可以自助入住,随时到都可以哒~\n正常入住时间:15点后 | 退房时间为:12点前\n\n (Website hidden by Airbnb) \n+打扫卫生:\n房间采取“一客一扫”,我都会请【专业保洁】来全套大扫除｡床单､被罩､毛巾一定会更换并消毒!空气很温柔,房间很干净~\n\nPS:房间家具和墙壁､装饰品也请您呵护哦｡\n\n\n+小区\n二环里的现代高层公寓,物业管理严格,生活氛围浓厚,安全您放心!\n\n\n+照片\n照片为实拍图案,基本房源真实情况,【本房比照片上更漂亮!】\n\n·\n\n\n房间是整租哒,您可以自由出入哦\n\n·\n\n\nHi,我是你的可爱房东,很高兴认识你\n与小伙伴经营民宿两年之久,已是帝都成熟有魅力,可爱又细腻的最棒包租公婆｡\n\n\n喜欢旅行和民宿的你,也一定也是个有趣的人,\n厌倦了酒店式的千篇一律和毫无新意\n住进当地人的家,才会收获最真实的生活与感动｡\n相信我的美屋会带给你一段特别的旅程与回忆｡\n\n\n我也会为房客家人们\n提供:【最地道最新鲜的帝都生活出行指南!】\n带你:去体验不太一般的当地活动或鲜有人知的城市秘境\n认识:更多个性有趣的当地朋友\n我们用自己的抖音号【朝阳楼花】记录了这间房子的改造过程和民宿故事\n欢迎你成为每一次故事的主题\n\n\n如果小屋已被预订,【点击我的头像】可以看到更多可爱的家｡\n您预定前我们可以在Airbnb平台沟通,我会保持在线,有任何问题都可以联系我｡\n当然预定确认后,更希望是常驻 (Hidden by Airbnb) 的“最佳损友”\n\n·\n\n\n我家在故宫西侧的灵境胡同附近,这一代历经了百年来新旧交替的传奇演变,从古时贵族､文人墨客的旧居,到民国中西融汇的新式建筑,到如今金融街日新月异,高耸林立的摩天大厦,十足见证了北京这座皇城的辉煌､兴衰､重生的历史轨迹｡非常值得花费时间来游走一番!\n\n\n1､我家楼下便是亚太地区金融中心的【北京金融街】,元､明之际及清代初期这里就已是,遍布银号､金坊,商贾富豪及皇亲国戚多在此地发迹生财,是繁华的商业区和金融中心｡\n\n\n2､700米步行至当地人和年轻时尚族､游人必打卡地【西单步行街】,西单婚庆大厦､大悦城､君太百货､汉光百货,吃喝玩乐应有尽有\n\n\n3､毗邻皇城中心景区:\n10多分钟车程:天安门､故宫､北海公园､国家博物馆､首都博物馆､什刹海､酒吧街｡白天逛古迹､夜里嗨酒吧,享受老北京人悠闲的“懒”日子\n\n\n4､400米步行至:北京协和医院西院､北京儿童医院｡还临近多家著名医院:宣武医院､北京市第二医院等\n\n·\n\n\n1､到达我家的最近地铁站\n4号线【灵境胡同】站,D口,步行800米\n1站￫西单\n2站￫天安门西 \n3站￫南锣鼓巷\n5站￫北京南站\n6站￫北京西站\n\n \n2､火车站\n  【北京南站】打车30分钟/地铁5站28分钟\n  【北京西站】打车/地铁30分钟\n\n\n3､机场\n  【首都国际机场】打车40分钟\n\n\nPS:在您成功预定【春风十里】后,将会收到我制作的详细想路图,我会在每个地铁口､十字路口､地标建筑前拍照,陪着你快速回家~",
