                "comments": "首先要夸的是房东小姐姐!人超级无敌好,我在外面打不开门然后小姐姐特地跑过来帮忙开了(小姐姐说门锁后面会换,所以大家之后要住也不用担心门的问题)\n之后就是夸房子乐!\n住的地方是个胡同,很好找,小姐姐给了超级详细的教程,离地铁站也是真滴近,附近也有小卖部,出门旅游时去故宫什么的也特别快｡\n胡同里的爷爷奶奶人都特别好qwq超级无敌爆炸热心!隔壁还有两只特别粘人的小猫(我爱小白一辈子jpg.)虽然是胡同,但是外卖也是OK的,小哥都知道｡\n屋子里调节温度的设施有空调､电暖和热风机(也可以调冷风)牙刷是新的不用担心,也有洗发水护发素沐浴露,物品都是很全备的,而且每个房客来之前保洁阿姨都会来打扫一遍所以也很干净……包括电冰箱､微波炉什么的也完全OK!\n\n总之都超级完美啦!Wi-Fi也是很快的完全OK",
