                "access": "所有区域",
                "author_type": "human",
                "description": "鼓楼脚下独一无二的地理位置!有独立的小院儿和露台｡无论在房间还是在院子里抬头就能看到宏伟的鼓楼｡房屋外部保留了老北京胡同瓦房结构｡有历史感的屋檐以及木质房顶结构都得以保留｡内部经过全新改造,配备有现代设施和精美的家具｡让您在感受老北京气息的同时,也可以享受一切现代化的生活设施,确保入住的舒适｡\n院子里还有一棵很大的香椿树,如果你来对季节,在小院的露台上伸手就可以摘下香椿,在厨房里为您的饭桌加道菜｡夏天,香椿树枝繁叶茂,为我们的院子和露台遮去大部分阳光｡坐在露台或者院子里品一杯茶｡感受老北京惬意的胡同生活｡\n 我们为您准备了一切生活必须品,包括毛巾,一次性拖鞋,一次性牙刷牙膏,沐浴露,洗发水,洗手液,吹风机 厨房用品:微波炉 洗衣机 冰箱 油 盐 酱油 餐具 洗洁精 刷碗布 茶具\n\n独特的地理位置 坐落在北京的中轴线鼓楼旁边的第一户四合院内｡院内有一颗很具北京胡同特色的香椿树｡无论在院子里露台上还是在房间内抬头都能看见鼓楼｡院子是独门独院,院子内放有秋千,傍晚时分在露台上品一杯茶,足不出户已置身景点之中｡\n\n所有区域\n\n位置真的是无敌的｡鼓楼旁第一家,距离鼓楼几步距离｡定位鼓楼就能找到小院啦｡ 钟鼓楼位于北京的中轴线,也就是北京最中心的位置｡您正南方直线就是景山.故宫.天安门等主要景点｡正北方是鸟巢水立方\n\n300米至:8号线【什刹海】地铁站,直达鸟巢 .水立方 5分钟步行至:南锣鼓巷､什刹海(后海) 多路公交直达景山 故宫 \n去往八达岭长城:8号线转市郊铁路S2线 即可到达 或者在故宫搭乘八达岭长城一日游",
