                "about": "——关于掌宿CactusSpace\r\n\r\n掌宿CactusSpace的核心理念是｢住+展｣, 打造的是一个融入生活中的艺术民宿｡与来自世界各地的友人分享这一切,在通过预订入住的时间里,与展出作品有足够多的时间相处,让您沉醉其中细细欣赏墙上展示的艺术作品,和艺术家完成隔空对话｡\r\n\r\n与此同时,掌宿CactusSpace致力于挖掘和培养国内外青年艺术家,发现好作品,帮艺术家在民宿里举办展览,合作后的收益共赢｡\r\n\r\n在入住民宿过程中,房子里展示的每一件作品都可以购买带回家中,如果你有意向,欢迎联系房东询价｡\r\n\r\n\r\n——关于房东二笼\r\n\r\n二笼原本是一名平面设计师,曾在Uber,豆瓣都工作过｡2017年中旬开始和朋友一起创业做民宿这件事,最早的核心团队成员包括Davy(前Uber同事),阿超(室内设计师,大学校友)｡\r\n\r\n如果你想和我聊聊设计,聊聊艺术创作和摄影,我乐意至极｡欢迎你来CactusSpace做客｡\r\n\r\n\r\n——关于合作\r\n\r\n如果您也热衷于创作,包括但不限于摄影,绘画,插画等架上艺术,欢迎投稿给我们,筛选到合适的作品后,我们乐意帮你在我们的空间展览您的作品｡\r\n\r\n如果您有闲置房屋或优质物业等资源,欢迎与我们联系,我们提供设计改造,代运营,品牌加盟等,合作收益共赢｡\r\n\r\n\r\n",
