                "space": "说起北京,你想到的是什么?是明清京城?还是南锣鼓巷?还是豆汁､杂酱面､北京烤鸭?今天推荐北京最好的居住条件是优越的:北京的高端居住环境优越,居住在特色民宿小房子里,繁华的大望京就在眼前｡楼下是优乐汇商圈,一站式吃喝玩乐｡步行5分钟即可到达麒麟商圈､望京SOHO商圈､望京商务中心商圈｡-步行5分钟看北京SOHO｡步行 (Phone number hidden by Airbnb) 分钟,即当地美术学院｡-步行500米即是14号线[福东]站[望京南]站,无缝换乘至北京南站｡-30分钟车程:首都国际机场有点刺激,继续看这里:+房间:60 1间,1间,1间,1间厨房,1间浴室+床:2张大床,可容纳3-4人+家:网络电视,蓝气空气污染者,地板供暖,空调,全墙储物柜,家用拖鞋,雨伞,智能门锁,火灾灭火器+厨房:电磁炉､热水壶､冰箱､电饭锅､炊具锅､汤匙､筷子､切菜机､金龙豆油､基本调味品､洗涤剂+厕所:洗衣机､洗衣粉(液体)､电热水器､暖气､24小时淋浴､高档毛巾､浴室拖鞋､Dispo貂皮牙科用具,衣架,吹风机,一套滋生堂洗发水,沐浴露,面霜+自助在家里随时可以自救｡到正常入住时间:15点后退房时间为:12点前+清洁和清洁:房间采取“一客一扫”,我将邀请[专业清洁]完成清洁｡床单､被套和毛巾将被更换和消毒!空气很柔和,房间很干净——PS:房间的家具和墙壁,装饰也请注意哦｡加上望京索霍附近的古公寓,物业管理十分严格,社区生活极为便利和安全｡你很担心!____加上这些照片都是真实的照片,[我们的房间比照片更漂亮!]",
                "summary": "有了娃之后两人世界基本没了,每天除了讨论娃!还是讨论娃! 完全没有时间去享受夫妻甜蜜时光,不如趁周末带亲爱的去浪一圈｡说到玩要是住的不好, 旅行就变成受罪,     其实现在的民宿越来越赞,带你去感受一下:有种旅行,叫住民宿!特色民宿坐落在望京soho旁边的现代公寓里,视野无敌.震撼夜景,给你一座城市的光彩｡精品民宿.卧室是一张1.5床.特色民宿客厅是一张1.3米的沙发床,易于打开和关闭,卧室可以锁定,以确保隐私｡ 特色民宿还精心挑选了美丽超亲肤的纯棉床上用品｡生活在3-4人就像时尚杂志｡这里汇集了各种现代元素和美好的事物,简单的现代设计让人感到神清气爽｡似乎有一秒打开了假期的道路,浅灰色棉麻沙发,时尚信枕｡金属暖灯,绿色盆栽,格调清新｡在精品公寓舒适的角落里,给卧室的大窗户带来明亮而丰富的光线,精品酒店在王静苏荷的阳光下,可以面对正派浪漫的夜晚｡在阳光明媚的阳台上喝咖啡,欣赏风景｡或者只是享受阳光,都是很惬意的｡高品质的床配备有希尔顿甜蜜的梦之窗五星级配置,独立弹簧加乳胶床垫+希尔顿羽毛舒适床垫+丝绸被+上下两套枕头,一切只为您拥有一个完美的宝宝睡眠｡特色民宿100%一扫客房",
                "transit": "UL·park､ulopark悠乐汇\n精品民宿地铁:14号线､15号线\n公交线路:公交: (Phone number hidden by Airbnb) 路 ､运通 (Phone number hidden by Airbnb) 路､运通 (Phone number hidden by Airbnb) 路"
