                "author_type": "human",
                "description": "请看清楚,这间是网红大吊床,完全吊起来的｡\n\n欢迎光临我们的家!\n【房间配备了投影仪,您可以躺在大床上舒服的看电影】\n【密码锁自助入住】\n【这是望京超级性价比的房子,你一定会喜欢的｡】\n【彩蛋:房间内还有女孩子喜欢的秋千,拍照神器】\n【除此之外还有空调､电视､免费百兆wifi､自己独立卫生间,24小时热水､冰箱､洗衣机｡\n洗漱用品､毛巾浴巾和吹风机都为您准备齐全｡】\n【如果您想做饭,厨房免费提供给您,快来大展厨艺吧】\n【也可以为您的商务出行提供发票,您承担的税点钱可以开到发票金额里】\n————————————\n【实习】\n商圈最中心,阿里巴巴､奔驰大厦､摩托罗拉等大咖公司近在咫尺;\n【考研培训】\n三所大学在附近,中央美术学院､青年政治学院､中央医药大学;\n【旅游】\n酒仙桥798艺术中心打车10分钟,首都机场打车20分钟,地铁15分钟到鸟巢奥体中心,清华和北大,地铁直达不用换乘｡\n【周边介绍】\n望京是北京发展最快的商务区,也是韩国人居住区｡周边除了美名京城的“望京小腰”~\n步行10分钟内可以到达大多数写字楼,是商务旅行､实习居住的佳选｡",
