                "comments": "房间的位置很好,离地铁口也很近,比预想中好很多｡四合院装修很好看,有很多间,房间里的装修也很温馨｡阿姨人很热情,一直不停的和我们聊天,(阿姨还养了两只猫猫和两只狗狗,超级可爱)｡房东小姐姐很好说话,我们去的第一天本来是四个人的,但因为有一个人只住一天,房东就只算了三个人,价格也便宜了不少｡小姐姐真的特别热情,发消息基本秒回｡不过房间有点小,不建议两人以上入住｡我们有一天晚上住了四个人,确实有点挤｡如果追求舒适度的话,最好只住一个人或两个人｡总体印象很好,我还把房子推荐给了我的朋友｡下次再来还会选择!",
